// react class component 
import React, {Component}  from 'react';
import Cell from './Cell'; 

export default class Board extends Component { 
  renderCell(i){
    return <Cell value={this.props.Cells}
            onClick={() =>this.props.onClick[i]}
            />
  }
  render(){
      return(
        <div>
          <div className="border-row">
                {this.renderCell(0)}
                {this.renderCell(1)}
                {this.renderCell(2)}
          </div>
          <div className="border-row">
                {this.renderCell(3)}
                {this.renderCell(4)}
                {this.renderCell(5)}
          </div>
          <div className="border-row">
                {this.renderCell(6)}
                {this.renderCell(7)}
                {this.renderCell(8)}
          </div>

        </div>
      );
  }
}





